import React, { Component } from 'react';
import { addUser } from '../../actions/index'
import { connect } from 'react-redux'

class SignUp extends Component {

  state = {
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    passwordConfirmation: ''
  }

  handleChange = (event) => {
    console.log(event.target.name, event.target.value)
    // this.setState({ event.target.name: event.target.value })
  }

  render() {
    console.log(this.props)
    console.log('SIGN UP STATE: ', this.state);
    return (
      <div>

        <form onSubmit={(event) => {event.preventDefault(); this.props.addUser(this.state)} }>
          <label> First Name: </label>
          <input type="text" name='firstName' onChange={this.handleChange}></input>

          <label> Last Name: </label>
          <input type="text" name='lastName' onChange={this.handleChange}></input>

          <label> Email: </label>
          <input type="text" name='email' onChange={this.handleChange}></input>

          <label> Password: </label>
          <input type="text" name='password' onChange={this.handleChange}></input>

          <label> Password Confirmation: </label>
          <input type="text" name='passwordConfirmation' onChange={this.handleChange}></input>

          <button> Signup </button>
        </form>

      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    user: state.user
  }
}

const mapDispatchToProps = dispatch => {
  return {
    addUser: user => dispatch(addUser(user))
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(SignUp)
